import React, { Component } from 'react';
import ItemsList from '../ItemsList/ItemsList'
import styles from './TableRow.module.css';

class TableRow extends Component{
    render(){
        return(
            <div className={styles.tableRowContainer}>
                <h1> {this.props.isHead ? 'Code Name' : this.props.codeName}{}</h1>
                <p> {this.props.isHead ? 'Description' : this.props.description}{}</p>
                <h3> {this.props.isHead ? 'Date' : this.props.date}{}</h3>

                <ItemsList itemsListHeader='Guests'/>
                <ItemsList itemsListHeader='Need Things'/>

                {!this.props.isHead ? <div>
                   <button onClick={()=>this.redactHandleClick()}>Redact</button>
                    <button onClick={()=> this.deleteHandleClick()}>Delete</button> 
                </div> : ''}

            </div>
        )
    }

    redactHandleClick(){
        console.log("Redact Click on : ",this.props.codeName);
    }
    deleteHandleClick(){
        console.log("Delete Click on : ",this.props.codeName);
    }
}

export default TableRow;
